import React from 'react'
import { useState } from 'react'



export const Count = () => {

    const [num,setNum] = useState(0);

      const plus = () => {
        setNum(num + 1);
      }

      const sub = () => {
        setNum(num - 1);
      }

      const reset = () => {
        setNum(0);
      }

      const [color,setColor] = useState('red');

      const colorChange = () => {
        setColor('blue');
        document.querySelector('.box').style.height = '100px';
        document.querySelector('.box').style.width = '200px';
        document.querySelector('.box').style.transition = 'width 0.5s';
      }

  return (
    <div> <br />
        <h2>This is the Count component</h2>

        <div class='box' style={{backgroundColor: color}}></div> <br />
        <button onClick={colorChange}>color change</button>

        <h1>{num}</h1>
        <button onClick={plus}>+</button> &nbsp;
        <button onClick={sub}>-</button> &nbsp;
        <button onClick={reset}>reset</button> <br /><br />
    </div>
  )
}
